s($,"b5_","aLK",()=>{var q=t.s
return A.d([A.NG(B.fJ,'# Nombres et alg\xe8bre\n## Suites et s\xe9ries \n- Une suite (aussi appel\xe9e progression) est une liste de nombres \xe9crits dans un ordre particulier.  \n- Chaque nombre d\u2019une suite est appel\xe9 un terme.  \n- Une suite finie poss\xe8de un nombre fixe de termes.  \n- Une suite infinie poss\xe8de une infinit\xe9 de termes.  \n- On peut trouver une formule ou une expression qui d\xe9crit math\xe9matiquement le terme g\xe9n\xe9ral u\u2099.  \n\n- Une suite est dite arithm\xe9tique lorsqu\u2019on ajoute la m\xeame valeur \xe0 chaque terme pour obtenir le suivant.  \n- Une suite est dite g\xe9om\xe9trique lorsqu\u2019on multiplie chaque terme par la m\xeame valeur pour obtenir le suivant.  \n- Une suite r\xe9currente utilise le ou les termes pr\xe9c\xe9dents pour calculer le suivant (notation u\u2099\u208b\u2081 pour \u201cle terme pr\xe9c\xe9dent\u201d).  \n\n- Une s\xe9rie est cr\xe9\xe9e lorsque l\u2019on additionne les termes d\u2019une suite.  \n- Une s\xe9rie peut \xeatre finie ou infinie.  \n\nExemple de s\xe9rie finie :  \n2 + 5 + 3 + 1 - 1 - 3 (elle s\u2019arr\xeate apr\xe8s le 6\u1d49 terme)  \n\nExemple de s\xe9rie infinie :  \n10 + 8 + 6 + 4 + ... (les points indiquent que la s\xe9rie continue ind\xe9finiment)  \n## Formules des suites et s\xe9ries\n- Terme g\xe9n\xe9ral d\u2019une suite arithm\xe9tique :  \nu_n = u_1 + (n - 1)d \n\n- Relation entre deux termes :\nu_n = u_m + (n - m)d\n\n- Terme g\xe9n\xe9ral d\u2019une suite g\xe9om\xe9trique :  \nu_n = u_1 \xd7 r^(n-1)  \n- Relation entre deux termes :\nu_n = u_m \xd7 r^(n-m) \n\n### Somme d\u2019une s\xe9rie arithm\xe9tique (2 formes possibles) :  \nS_n = (n/2)(u_1 + u_n)  \nS_n = (n/2)(2u_1 + (n - 1)d)  \n\n### Somme d\u2019une s\xe9rie g\xe9om\xe9trique finie :  \nS_n = u_1(1 - r\u207f) / (1 - r)=u_1(r\u207f-1) / (r-1),   "avec"  r \u2260 1  \n\n### Somme d\u2019une s\xe9rie g\xe9om\xe9trique infinie (si |r| < 1) :  \n S\u221e =u_1/(1-r)\n\n## Int\xe9r\xeat simple et compos\xe9\n- Soit P le montant principal, A le montant accumul\xe9, r le taux d\'int\xe9r\xeat annuel  et n le nombre d\'ann\xe9es.\n- **Int\xe9r\xeat simple** : calcul\xe9 uniquement sur le capital initial (appel\xe9 principal). \n\nA=P(1 + nr) \n- **Int\xe9r\xeat compos\xe9** : calcul\xe9 sur le capital **et** les int\xe9r\xeats accumul\xe9s (int\xe9r\xeat sur int\xe9r\xeat).  \n\nA=P(1 + r)^(n)\n## Combinaison \n C(n, r) = n! / [r!(n - r)!]  \n\nn!=n(n-1)(n-2)(n-3) ...3\xd72\xd71\n\n## Terme d\'un d\xe9veloppement  (a+b)\u207f\n- Pour trouver un terme d\'un d\xe9veloppemment, il est plus facile d\'utiliser la formule donnant les termes que de d\xe9velopper. \n- Un terme quelconque  du d\xe9veloppement  de (a+b)\u207f est donn\xe9 par :\n\nC(n, r)a^(n-r)b^(r)  "o\xf9" r="terme"-1\n\n## Preuves math\xe9matiques\n- Une **preuve math\xe9matique** est une suite d\u2019\xe9tapes logiques qui montrent qu\u2019un c\xf4t\xe9 d\u2019une \xe9galit\xe9 est \xe9quivalent \xe0 l\u2019autre, pour toutes les valeurs de la variable.  \n- On a besoin de preuves pour garantir que les math\xe9matiques utilis\xe9es sont correctes et coh\xe9rentes.  \n\nNotation :  \n\xc0 la fin d\u2019une preuve, on \xe9crit souvent : \n-LHS = RHS (Left Hand Side = Right Hand Side). \n\n\nExemple \n-Montrez que:  (2n-1)\xb2  +  (2n+1)\xb2= 8n\xb2 + 2\n\n## Logarithmes\n### D\xe9finition :\n" Si"  a^x = b, "alors"  log_a(b) = x\n\n### Propri\xe9t\xe9s principales :\n log_a(xy) = log_a(x) + log_a(y)\n log_a(x/y) = log_a(x) - log_a(y)\n log_a(x\u207f) = n \xd7 log_a(x)\n log_a(a) = 1\n log_a(1) = 0\n\n### Changement de base :\n log_a(x) =(log_b(x))/log_b(a)\n\n### Logarithme naturel :\n ln(x) = log_e(x)\n \n##  Lois des exposants\n### R\xe8gles principales :\n a^m \xd7 a\u207f = a^(m+n)\n a^m / a\u207f = a^(m-n)\n (a^m)\u207f = a^(mn)\n (ab)\u207f = a\u207fb\u207f\n a\u2070 = 1   "si"  a \u2260 0\n a^(-n) = 1/a\u207f\n### Remarques\n\n\n log_a(a^x) = x  "et" a^(log_a x) = x\n\nExemples :\n- 2\xb3 \xd7 2\xb2 = 2\u2075 = 32\n- x\u2074 \xf7 x\xb2 = x\xb2 \n- (3\xb2)\xb3 = 3\u2076 = 729\n ',"theme1",B.D,"Nombres et alg\xe8bre",A.d(["Suites et s\xe9ries arithm\xe9tiques et g\xe9om\xe9triques ","Lois des exposants et  des logarithmes","Formule du bin\xf4me de Newton","Preuve math\xe9matique"],q)),A.NG(B.fJ,"# Fonctions\n## Relations et fonctions\n- Une relation math\xe9matique est une correspondance entre un ensemble de paires ordonn\xe9es.\n\n- Une fonction est un type particulier de relation. Une relation est une fonction si chaque entr\xe9e correspond \xe0 une seule sortie. En d\u2019autres termes, une valeur de la variable ind\xe9pendante ne peut donner plus d\u2019une valeur de la variable d\xe9pendante. Une fonction ne peut pas avoir une m\xeame valeur de x associ\xe9e \xe0 plusieurs valeurs de y.\n\n- Lorsqu\u2019on \xe9crit une expression pour une fonction, il existe plusieurs notations. Par exemple : f(x), g(x), f:\u2192. On appelle cela la notation fonctionnelle.\n\n- f(x),  \u201clire f de ' x, ' repr\xe9sente une fonction f dont la variable ind\xe9pendante est x'.\n\n- La notation fonctionnelle est une fa\xe7on rapide d\u2019exprimer la substitution. Au lieu de dire :\n- \xc9tant donn\xe9  y = 4x - 3', trouver la valeur de y si  x = 2,\n- on peut simplement \xe9crire : \xe9tant donn\xe9 f(x) = 4x - 3, trouver f(2).\n-Le domaine d\u2019une fonction est l\u2019ensemble des valeurs possibles de la variable ind\xe9pendante (x).\n\n-L\u2019ensemble image (ou valeurs de sortie) d\u2019une fonction est l\u2019ensemble des valeurs possibles de la variable d\xe9pendante (y).\n\n## Dessiner et Esquisser\n-Dessiner et Esquisser sont deux termes de consignes du BI qu\u2019il faut conna\xeetre :\n\n-Dessiner : repr\xe9senter \xe0 l\u2019aide d\u2019un diagramme ou d\u2019un graphe pr\xe9cis et l\xe9gend\xe9, au crayon. Une r\xe8gle (droite) doit \xeatre utilis\xe9e pour tracer les segments. Les diagrammes doivent \xeatre \xe0 l\u2019\xe9chelle et les points correctement plac\xe9s (le cas \xe9ch\xe9ant), reli\xe9s par une droite ou une courbe r\xe9guli\xe8re.\n\n -Esquisser : repr\xe9senter \xe0 l\u2019aide d\u2019un diagramme ou d\u2019un graphe (l\xe9gend\xe9 si n\xe9cessaire). Le sch\xe9ma donne une id\xe9e g\xe9n\xe9rale de la forme ou de la relation, et doit inclure les \xe9l\xe9ments importants.\n\n-La notation d\u2019intervalle utilise des crochets et parenth\xe8ses :\n( ) ou ] [ signifient que les valeurs ne sont pas incluses.\n\n-[ ] signifient que les valeurs sont incluses.\n## Fonction  par morceaux\nUne fonction d\xe9finie par morceaux est une fonction qui poss\xe8de deux ou plusieurs expressions pour diff\xe9rents intervalles de son domaine.\nExemple\nf(x)={ x+2, 4-x, si x<1, si x>1 }\n## Fonction compos\xe9e\n-Une fonction compos\xe9e, not\xe9e f(g(x)) ou (fog)(x), peut \xeatre vue comme une suite d\u2019op\xe9rations ou de \u201cmachines\u201d. Ces deux notations se lisent \u201cf de g de x\u201d.\n\n-Pour travailler avec une fonction compos\xe9e telle que f(g(x)), on commence par la fonction la plus \xe0 l\u2019int\xe9rieur, puis on progresse vers l\u2019ext\xe9rieur.\n\nLe domaine et l\u2019ensemble image d\u2019une fonction compos\xe9e d\xe9pendent \xe0 la fois de la fonction int\xe9rieure et de la fonction compos\xe9e elle-m\xeame.\n## Fonctions inverses\n-L\u2019inverse d\u2019une fonction f(x) est not\xe9 \nf^{-1}(x).\n\n- Il inverse l\u2019action de la fonction, de sorte que :\n(fof^{-1})(x) = x \n\nPour qu\u2019une fonction ait un inverse, elle doit \xeatre bijective (ou une-\xe0-une). Cela signifie qu\u2019elle associe un seul y \xe0 chaque x, et un seul x \xe0 chaque y. Une telle fonction passe \xe0 la fois le test de la verticale et le test de l\u2019horizontale.\n\n-Deux fonctions 'f(x)' et 'g(x)' sont inverses si et seulement si :\n \n (fog)(x) = (gof)(x) = x.\n\nPour trouver l\u2019\xe9quation d\u2019une fonction inverse alg\xe9briquement : on \xe9change x et y, puis on isole y.\n\nPour tracer le graphe d\u2019une fonction inverse :\n\n-on trace la fonction originale,\n\n-on choisit quelques points caract\xe9ristiques (intersections avec les axes, etc.),\npuis on \xe9change les coordonn\xe9es (x, y) \u2192 (y, x).\n-Cela donne une sym\xe9trie par rapport \xe0 la droite  'y = x'.\n\n## Transformations de  y=f(x) \n\n### Translations verticales:  \n\n y=f(x)+k \n \n - Vers le haut de   k unit\xe9s  si   k>0 ;\n - Vers le bas de  |k|  unit\xe9s  si   k<0 \n \n### Translations horizontales:\n \n   y=f(x-h)\n   \n  -Vers la droite  de   h unit\xe9s  si   h>0 ; \n  - Vers la gauche  de  |h|  unit\xe9s  si   h<0 \n\n\n### R\xe9flexion par rapport \xe0 l'axe des abscisses:\n\n y=-f(x)  \n\n###  R\xe9flexion par rapport \xe0 l'axe des ordonn\xe9es: \n\n y=f(-x) \n\n\n### Dilatation verticale de facteur  |a| :\n\n y=af(x) \n \n - \xc9tirement vertical si |a|>1 ; \n -Compression verticale si 0< |a|<1\n \n### Dilatation horizontale de facteur 1/|q| :\n\n y=f(qx) \n\n- \xc9tirement horizontal si  0< |q|<1  ; Compression horizontale si  |q|>1\n\n## Graphiques des fonctions lin\xe9aires\n\n-Le coefficient directeur (ou pente) d\u2019une droite passant par deux points peut \xeatre calcul\xe9 \xe0 partir de leurs coordonn\xe9es.\n\n-Les droites parall\xe8les ont le m\xeame coefficient directeur.\n\n-Le produit des coefficients directeurs de deux droites perpendiculaires est -1.\n\n-Pour une fonction lin\xe9aire sous la forme y = mx + c : la pente est m, l\u2019ordonn\xe9e \xe0 l\u2019origine est (0, c).\n\n-Pour une fonction lin\xe9aire sous la forme y \u2013 y\u2081 = m(x \u2013 x\u2081) : la droite passe par le point (x\u2081, y\u2081) et sa pente est m.\n\nLa forme g\xe9n\xe9rale de l\u2019\xe9quation d\u2019une droite est :\n ax + by + d = 0.\n\n## Graphiques des fonctions quadratiques\n\nPour une fonction quadratique de la forme;\n\n f(x) = a(x \u2013 h)\xb2 + k \n\n-le sommet est (h, k),\n\n-l\u2019axe de sym\xe9trie est x = h.\n-Les transformations du graphe de y = x\xb2 permettent de tracer cette forme.\n\n-Pour une fonction quadratique de la forme f(x) = ax\xb2 + bx + c :\n\n-l\u2019axe de sym\xe9trie est donn\xe9 par x = \u2013b /2a,\n\n-l\u2019ordonn\xe9e \xe0 l\u2019origine est (0, c).\n\n-Pour une fonction quadratique de la forme f(x) = a(x \u2013 p)(x \u2013 q) :\n\n-les intersections avec l\u2019axe des abscisses sont (p, 0) et (q, 0),\n\n-l\u2019axe de sym\xe9trie est x = (p + q) / 2.\n\n### R\xe9solution des \xe9quations quadratiques\n\n-L\u2019\xe9quation x\xb2 = c, avec c > 0, a deux solutions : \n\nx = \u221a(c)  \"et\"  x = \u2013\u221a(c).\n-On peut aussi \xe9crire :\n\n x = \xb1\u221a(c).\n\nPour r\xe9soudre une \xe9quation quadratique par factorisation :\n\n-on met l\u2019\xe9quation sous forme factoris\xe9e,\n\n-on applique la propri\xe9t\xe9 du produit nul (chaque facteur = 0).\n\nPour r\xe9soudre une \xe9quation quadratique par compl\xe9tion du carr\xe9 :\n\n-diviser les deux membres par le coefficient de x\xb2,\n\n-isoler les termes en x\xb2 et x,\n\n-ajouter le carr\xe9 du demi-coefficient de x,\n\n-mettre le membre de gauche sous forme de carr\xe9 parfait,\n\n-r\xe9soudre pour x.\n\n-La formule quadratique (formule canonique) pour r\xe9soudre ax\xb2 + bx + c = 0 est :\n\nx= (-b \xb1 \u221a(b\xb2 - 4ac))/2a , \"avec\" a \u2260 0.\n\n-Selon le discriminant \u0394 = b\xb2 \u2013 4ac :\n\n-Si \u0394 > 0, il y a deux racines r\xe9elles distinctes.\n\n-Si \u0394 = 0, il y a deux racines r\xe9elles \xe9gales.\n\n-Si \u0394 < 0, il n\u2019y a pas de racines r\xe9elles.\n\n## La fonction r\xe9ciproque\n\n-La fonction  r\xe9ciproque est f(x) = k/x, o\xf9 k est une constante non nulle.\n\n-Le domaine de la fonction r\xe9ciproque est : x \u2208 \u211d, x \u2260 0.\n\n-L\u2019ensemble image est : y \u2208 \u211d, y \u2260 0.\n\n-Les limites de la fonction r\xe9ciproque f(x) = k/x sont :\n\n lim[x\u2192\xb1\u221e] f(x)=0  \n\n\t\n-asymptote horizontale : y = 0.\n\n lim[x\u21920^+]f(x)= \u221e   \"ou\"   lim[x\u21920^-]f(x)= \u221e\n\n\n-asymptote verticale : x = 0.\n\n-La fonction r\xe9ciproque est une fonction auto-inverse (self-inverse) car :\n-f(x) = f\u207b\xb9(x) pour tout x dans son domaine.\n-Graphiquement, son graphe est une sym\xe9trie par rapport \xe0 la droite y = x.\n\n## Fonctions rationnelles\n\nUne fonction rationnelle est une fonction de la forme :\nf(x) = (g(x))/h(x)\n-o\xf9 g(x) et h(x) sont des polyn\xf4mes.\n\n-\xc0 partir de la fonction de base y = 1/x, on peut g\xe9n\xe9rer d\u2019autres fonctions rationnelles, par exemple :\n\ny = (ax + b) / (cx + d)\n\n\nPour une fonction rationnelle de la forme :\ny = (ax + b) / (cx + d) :\n\n-l\u2019asymptote verticale est : x = \u2013d/c,\n\n-l\u2019asymptote horizontale est : y = a/c.\n\n### M\xe9thode pour tracer une fonction rationnelle  sans calculatrice\n\ny= ax+b/ cx+d\n\n-Trouver l\u2019asymptote verticale : r\xe9soudre cx + d = 0, donc x = \u2013d/c.\n\n-Trouver l\u2019asymptote horizontale : y = a/c.\n\n-Trouver l\u2019ordonn\xe9e \xe0 l\u2019origine : poser x = 0 et calculer y.\n\n-Trouver l\u2019abscisse \xe0 l\u2019origine (x-intercept) : poser y = 0 et r\xe9soudre pour x.\n\n-Tester les valeurs de part et d\u2019autre de l\u2019asymptote verticale pour d\xe9terminer si la courbe tend vers +\u221e ou \u2013\u221e.\n\n-Tracer les axes, les asymptotes, puis esquisser la courbe.\n","theme2",B.nX,"Fonctions",A.d(["Les \xe9quations de droites","Fonctions compos\xe9es et r\xe9ciproques","Fonctions quadratiques,homographiques, exponentielles et logarithmes","Transformations et graphiques"],q)),A.NG(B.fJ,'# G\xe9om\xe9trie et trigonom\xe9trie\n## G\xe9om\xe9trie dans l\u2019espace (3D)\n\n-Milieu de (x\u2081, y\u2081, z\u2081) et (x\u2082,y\u2082, z\u2082) :\nM((x_1 + x_2)/2, (y_1 + y_2)/2, (z_1 + z_2)/2)\n\nDistance entre (x\u2081, y\u2081, z\u2081) et (x\u2082,y\u2082, z\u2082) :\nd=\\sqrt{(x_2 - x_1)^2 +(y_2 - y_1)^2  + (z_2 - z_1)^2}\n## Solides usuels\n-Pyramide : base polygonale + faces triangulaires se rencontrant \xe0 l\u2019apex (sommet).\n-Pyramide droite : l\u2019apex est \xe0 la verticale du centre de la base.\n-Aire totale : somme des aires de toutes les faces.\n-Volume : \nV=1/3 \xd7"aire\xa0de\xa0base"\xd7"hauteur".\n-Pyramide \xe0 base carr\xe9e (c\xf4t\xe9 x, apoth\xe8me/slant l) :\n"Aire\xa0totale"=x^2 + 2xl\n-C\xf4ne (de r\xe9volution) : base circulaire de rayon r, g\xe9n\xe9ratrice l, hauteur h.\n"Aire totale :" \ud835\udf0br^2 +\ud835\udf0brl.\n "Volume :" V=1/3 \u03c0r^2 h.\nSph\xe8re : ensemble des points \xe0 \xe9gale distance d\u2019un centre.\n -H\xe9misph\xe8re : moiti\xe9 d\u2019une sph\xe8re.\n  "Aire :" 4\u03c0r^2\n   "Volume :" 4/3 \ud835\udf0b \ud835\udc5f^3\n## Triangle rectangle\nSOH\u2013CAH\u2013TOA :\nsin \ud835\udf03 =\\frac{"oppose\u02ca"}{"hypot\xe9nuse"} , " " cos \ud835\udf03 = \\frac{"adjacent"}{"hypot\xe9nuse"}, " " tan = \\frac{"oppos\xe9"}{"adjacent"}\n### Triangles  rectangles sp\xe9ciaux :\n- 45\xb0\u201345\xb0\u201390\xb0 : si l\u2019hypot\xe9nuse vaut h, alors chaque cathete vaut h/\u221a2.\n-30\xb0\u201360\xb0\u201390\xb0 : le c\xf4t\xe9 oppos\xe9 \xe0 30\xb0 vaut la moiti\xe9 de l\u2019hypot\xe9nuse.\n## Angles d\u2019\xe9l\xe9vation / de d\xe9pression :\n\xc9l\xe9vation : angle au-dessus de l\u2019horizontale vers l\u2019objet.\nD\xe9pression : angle au-dessous de l\u2019horizontale vers l\u2019objet.\n## Rel\xe8vements (bearings) :\n\xc0 trois chiffres : mesur\xe9s dans le sens horaire depuis le Nord (ex. 120\xb0, 052\xb0, 314\xb0).\nType boussole : depuis N ou S vers E ou W (ex. N20\xb0E, S36\xb0E, N55\xb0W, S67\xb0W).\n## Mesure en radians & cercle\nD\xe9finition du radian : angle au centre interceptant un arc de longueur r sur un cercle de rayon r.\nConversions : \n"degr\xe9s" \\rightarrow "radians:"\xd7 \u03c0 /180,  "radians"\\rightarrow "degr\xe9:"\xd7 180/\u03c0\n-(ainsi 1 \xa0rad \u224857,3\xb0).\n## Longueur d\u2019arc : \ns=r\u03b8 "(avec \u03b8 en radians)".\n## Aire d\u2019un secteur : \nA = 1/2 r^2 \u03b8\n### Cercle trigonom\xe9trique (unit\xe9) : centre \xe0 l\u2019origine, rayon 1.\n\nIdentit\xe9s utiles (en degr\xe9s) :\n\nsin\u2061 \ud835\udf03 = sin(180\xb0 \u2212 \ud835\udf03)," " cos \u2061\ud835\udf03 = cos(-\ud835\udf03 )=cos (360\xb0 \u2212 \ud835\udf03)," " tan\u2061 \ud835\udf03 = tan(180\xb0 \u2212 \ud835\udf03)\n## Mod\xe8les sinuso\xefdaux\n"Forme :"  y=asin(b(x\u2212c))+d "ou" y=acos(b(x\u2212c))+d.\n"Amplitude :" \u2223a\u2223 =(max\u2061 \u2212 min )/2\u2061\n"P\xe9riode :" T =\\frac{2\u03c0}{|b|}\n" La p\xe9riode est la distance horizontale entre deux motifs identiques (par exemple, entre deux maxima cons\xe9cutifs)."\n"D\xe9calage vertical :" d =( max \u2061+ min)/2\u2061\n### "D\xe9calage horizontal c (phase)\'\n"Utiliser un  point connu (maxima, minima, passages par z\xe9ro) et de remplacer ses coordonn\xe9es  dans l\'\xe9quation de la fonction puis r\xe9soudre c."\n',"theme3",B.ajk,"G\xe9om\xe9trie et trigonom\xe9trie",A.d(["Distance, milieu,aire , volume dans l'espace","G\xe9om\xe9trie du triangle, Lois des sinus et des cosinus. Cercle et \xe9quations trigonom\xe9triques","Fonctions trigonom\xe9triques"],q)),A.NG(B.fJ,'# Statistiques et probabilit\xe9s\n# Statistiques\n## Les Donn\xe9es \nDonn\xe9es discr\xe8tes et continues\n-Les donn\xe9es discr\xe8tes ne peuvent prendre que certaines valeurs particuli\xe8res, chacune \xe9tant distincte des autres.\n-Les donn\xe9es continues, au contraire, ne sont pas limit\xe9es \xe0 un ensemble fixe de valeurs : elles peuvent prendre n\u2019importe quelle valeur dans un intervalle continu.\n\n### Fiabilit\xe9 et suffisance des donn\xe9es\n\nDes donn\xe9es sont dites fiables si, en r\xe9p\xe9tant le processus de collecte, on obtient des r\xe9sultats similaires.\n\nDes donn\xe9es sont dites suffisantes lorsqu\u2019elles sont en quantit\xe9 ad\xe9quate pour soutenir des conclusions valables.\n## Repr\xe9sentations graphiques\n\nUn diagramme en barres est utilis\xe9 pour repr\xe9senter des donn\xe9es discr\xe8tes.\n\nUn histogramme est utilis\xe9 pour repr\xe9senter des donn\xe9es continues.\n\nDans les \xe9preuves, on consid\xe8re g\xe9n\xe9ralement que l\u2019ensemble des donn\xe9es constitue la population.\n## Population et \xe9chantillon\nLa population d\xe9signe l\u2019ensemble des individus ou \xe9l\xe9ments que l\u2019on souhaite \xe9tudier.\nUn \xe9chantillon est un sous-ensemble de la population, choisi pour fournir des informations repr\xe9sentatives sur celle-ci.La population d\xe9signe l\u2019ensemble des individus ou \xe9l\xe9ments que l\u2019on souhaite \xe9tudier.\n## M\xe9thodes d\u2019\xe9chantillonnage\n Les principales m\xe9thodes incluent :\n-l\u2019\xe9chantillonnage par convenance,\n-l\u2019\xe9chantillonnage al\xe9atoire simple,\n-l\u2019\xe9chantillonnage syst\xe9matique,\n-l\u2019\xe9chantillonnage stratifi\xe9,\n-l\u2019\xe9chantillonnage par quotas.\n## Variance et \xe9cart-type\nL\u2019\xe9cart-type mesure la dispersion des donn\xe9es par rapport \xe0 la moyenne.\nL\u2019\xe9cart-type est la racine carr\xe9e de la variance, d\xe9finie par :\n\u03c3^2 = 1/n \u2211(x \u2212 \\overline{x})^2\nUne calculatrice graphique (GDC) est g\xe9n\xe9ralement utilis\xe9e pour d\xe9terminer ces mesures.\n## Effet des transformations sur les donn\xe9es\n-Ajouter une constante c \xe0 chaque valeur d\u2019un ensemble de donn\xe9es augmente la moyenne et la m\xe9diane de c, mais n\u2019a aucun effet sur l\u2019\xe9cart-type.\n-Multiplier chaque valeur par une constante d multiplie la moyenne et l\u2019\xe9cart-type par d, et la variance par d\xb2.\n## Mesures de dispersion\n-L\u2019\xe9tendue est la diff\xe9rence entre la plus grande et la plus petite valeur.\n-Les quartiles divisent un ensemble de donn\xe9es en quatre parties contenant chacune 25 % des observations.\n-Q\u2081 est la m\xe9diane de la moiti\xe9 inf\xe9rieure des donn\xe9es, et Q\u2083 est la m\xe9diane de la moiti\xe9 sup\xe9rieure.\n-L\u2019intervalle interquartile (IQR) est d\xe9fini par :\n                 IQR=Q_3 \u200b\u2212 Q_1\nLes m\xe9thodes de calcul des quartiles peuvent varier : les r\xe9sultats obtenus manuellement peuvent diff\xe9rer de ceux fournis par un logiciel.\nLe diagramme en bo\xeete et moustaches (boxplot) est une repr\xe9sentation visuelle permettant de r\xe9sumer un ensemble de donn\xe9es.\n## Valeurs extr\xeames (outliers)\nLes valeurs atypiques (ou outliers) sont celles qui s\u2019\xe9cartent fortement du reste des donn\xe9es.\nUne valeur est consid\xe9r\xe9e comme un outlier si elle est situ\xe9e au moins \xe0 1,5 IQR au-dessus de Q\u2083 ou en dessous de Q\u2081.\n##  Analyse bivari\xe9e\nL\u2019analyse bivari\xe9e \xe9tudie la relation entre deux ensembles de donn\xe9es.\n-Un nuage de points (scatter diagram) consiste \xe0 repr\xe9senter un ensemble de donn\xe9es sur l\u2019axe des abscisses (x) et l\u2019autre sur l\u2019axe des ordonn\xe9es (y).\n-Une corr\xe9lation existe entre deux variables x et y lorsqu\u2019une variation de x correspond \xe0 une variation de y.\n-Une tendance g\xe9n\xe9rale ascendante indique une corr\xe9lation positive.-Une tendance g\xe9n\xe9rale descendante indique une corr\xe9lation n\xe9gative.\n\nDes points dispers\xe9s sans tendance apparente peuvent indiquer une corr\xe9lation proche de z\xe9ro.\n\u26a0\ufe0f Une corr\xe9lation entre deux variables ne signifie pas n\xe9cessairement qu\u2019il existe un lien de causalit\xe9 entre elles.\n\n## Mesure de la corr\xe9lation\n\n-Le coefficient de corr\xe9lation lin\xe9aire de Pearson, not\xe9 r, (avec \u22121<r<1) mesure l\u2019intensit\xe9 de la corr\xe9lation entre deux variables x et y.\nIl est couramment utilis\xe9 pour \xe9valuer la force de la corr\xe9lation lin\xe9aire.\n## Interpr\xe9tation des valeurs de r :\n\nValeur de r\t         Interpr\xe9tation\n0<r<0.25\t       "Corr\xe9lation tr\xe8s faible"\n0.25<r<0.5\t     "Corr\xe9lation faible"\n0.5<r<0.75\t     "Corr\xe9lation mod\xe9r\xe9e"\n0.75<r<1\t        "Corr\xe9lation forte"\n## La droite de r\xe9gression (ou droite d\u2019ajustement)\nLa droite de r\xe9gression (ou droite de tendance, line of best fit) est une droite trac\xe9e au milieu d\u2019un nuage de points, de mani\xe8re \xe0 \xeatre aussi proche que possible de toutes les donn\xe9es.\nPour la tracer \xab \xe0 main lev\xe9e \xbb, on place une droite qui \xe9quilibre approximativement le nombre de points au-dessus et en dessous.\nUn raffinement consiste \xe0 imposer que la droite passe par le point moyen  de coordonn\xe9es:\n\n(\\overline{x}, \\overline{y})\n\n obtenu en calculant la moyenne des x et la moyenne des y.\n## Interpolation et extrapolation\nUne fois la droite de r\xe9gression trac\xe9e, on peut l\u2019utiliser pour faire des pr\xe9dictions.\nIl existe deux types de pr\xe9dictions :\n-Interpolation : estimation \xe0 l\u2019int\xe9rieur de l\u2019intervalle des donn\xe9es connues.\n- Extrapolation : estimation en dehors de l\u2019intervalle des donn\xe9es connues. \u26a0\ufe0f L\u2019extrapolation est souvent risqu\xe9e, car elle repose sur des hypoth\xe8ses hors domaine.\n## R\xe9gression par les moindres carr\xe9s\nLa droite de r\xe9gression des moindres carr\xe9s est celle qui minimise la somme des carr\xe9s des r\xe9sidus (\xe9carts entre les valeurs observ\xe9es et celles estim\xe9es par la droite).\nSon \xe9quation peut \xeatre obtenue gr\xe2ce \xe0 une calculatrice graphique (GDC).\nOn distingue :\n-la r\xe9gression de y en fonction de x (pour estimer y \xe0 partir de x),\n-la r\xe9gression de x en fonction de y (pour estimer x \xe0 partir de y).\nSi la corr\xe9lation est parfaite (tous les points align\xe9s), alors les deux droites de r\xe9gression sont identiques.\n\n# Probabilit\xe9 \nL\u2019\xe9tude des probabilit\xe9s nous aide \xe0 comprendre le degr\xe9 d\u2019incertitude qu\u2019un \xe9v\xe9nement se produise.\nL\u2019ensemble de tous les r\xe9sultats possibles d\u2019une exp\xe9rience est appel\xe9 l\u2019univers de cette exp\xe9rience. Il est not\xe9  U.\n-La notation n(U) d\xe9signe le nombre d\u2019\xe9l\xe9ments de l\u2019univers.\nLa probabilit\xe9 d\u2019un \xe9v\xe9nement A est donn\xe9e par :\nP(A)= (n(A))/(n(U))\n-o\xf9 n(A) est le nombre de cas favorables \xe0 A et n(U) le nombre total de cas possibles.\n-Si la probabilit\xe9 d\u2019un \xe9v\xe9nement est P, alors sur n r\xe9p\xe9titions, on s\u2019attend \xe0 ce que l\u2019\xe9v\xe9nement se produise environ n\xd7P fois.\n### Remarque\nEn math\xe9matiques, \xab ou \xbb inclut aussi la possibilit\xe9 de \xab \xe0 la fois \xbb.\nDonc \xab A ou B \xbb signifie \xab A \xbb ou \xab B \xbb ou \xab A et B \xbb.\nOn appelle cela le \u201cou inclusif\u201d.\nR\xe8gle de l\u2019addition :\nP(A\u222aB)=P(A)+P(B)\u2212P(A\u2229B)\n## \xc9v\xe9nements incompatibles (mutuellement exclusifs) :\n Ce sont des \xe9v\xe9nements qui ne peuvent pas se produire en m\xeame temps. Dans ce cas :\nP(A\u2229B)=0 "et"  P(A\u222aB)=P(A)+P(B)\n## \xc9v\xe9nements ind\xe9pendants\nDeux \xe9v\xe9nements A et B sont dits ind\xe9pendants si la r\xe9alisation de l\u2019un n\u2019affecte pas la probabilit\xe9 de l\u2019autre.\n\nSi A et B sont ind\xe9pendants :\nP(A\u2229B)=P(A) \xd7 P(B)\n##  Probabilit\xe9 conditionnelle\n-La notation P(A\\ B) d\xe9signe la probabilit\xe9 conditionnelle : la probabilit\xe9 que  A se produise sachant que B est r\xe9alis\xe9.\nPour deux \xe9v\xe9nements A et B :\nP(A\\setminus B)=P(A\u2229B)/(P(B))   "si"\xa0P(B)>0\n\nSi A et B sont ind\xe9pendants, alors :\nP(A\\setminus B)=P(A), " " P(B\\setminus A)=P(B)\net aussi :\nP(A\\setminus B\')=P(A), P(B\\setminus A\')=P(B)\nArbres de probabilit\xe9\nEn probabilit\xe9s, certaines situations impliquent un tirage avec remise ou sans remise, et les probabilit\xe9s calcul\xe9es diff\xe8rent selon le cas.\n\n## Probabilit\xe9s et lois de distribution\n\nPour un \xe9v\xe9nement A, on a :\n0<P(A)<1 "et" P(\u03a9)=1\nPour une variable al\xe9atoire discr\xe8te M, l\u2019esp\xe9rance est donn\xe9e par :\nE(M)=\u2211mP(M=m)\n## Loi binomiale\n-Si X est une variable al\xe9atoire discr\xe8te suivant une loi binomiale : X\u223cB(n,p) alors la probabilit\xe9 d\u2019obtenir r succ\xe8s au cours de n essais ind\xe9pendants (avec probabilit\xe9 de succ\xe8s p \xe0 chaque essai) est donn\xe9e par :\nP(X=r)=C(n, r) p^(r)q^(n-r) "o\xf9" q=1-p\n"Esp\xe9rance :" E(X)=np " " "Variance:" Var(X)=\u03c3^2=npq=np(1\u2212p)\n## Loi normale\nUne loi normale est sym\xe9trique par rapport \xe0 une valeur centrale et repr\xe9sent\xe9e par une courbe en cloche, avec la majorit\xe9 des valeurs regroup\xe9es autour de la moyenne.\nDans une distribution normale parfaite :\n-la courbe est en forme de cloche,\n-les donn\xe9es sont sym\xe9triques par rapport \xe0 la moyenne \u03bc,\n-la moyenne, la m\xe9diane et le mode sont confondus.\n\n## Standardisation\n-Pour transformer une valeur x d\u2019une variable al\xe9atoire X\u223cN(\u03bc,\u03c3\xb2) en une valeur r\xe9duite z\u223cN(0,1), on utilise la formule :\nz=(x\u2212\\mu)/\\sigma\n- \u03bc : moyenne\n- \u03c3\xb2 : variance\nCe processus est appel\xe9 standardisation.',"theme4",B.aiT,"Statistiques et probabilit\xe9s",A.d(["\xc9chantillonnage, moyenne, m\xe9diane, mode, diagramme en bo\xeete,coefficient de Pearson","Probabilit\xe9s simples et conditionnelles","Lois binomiale et normale"],q)),A.NG(B.fJ,'# Analyse math\xe9matique\n\n## R\xe8gles de d\xe9rivation de base\n\n"Si" f(x) = x^n, "alors" f\'(x) = nx^(n-1), "o\xf9" n \u2208 \u211d.\n\n"Si" f(x) = c, "avec" c \u2208 \u211d, "alors" f\'(x) = 0.\n\n"Si" f(x) = c.g(x), "alors" f\'(x) = c.g\'(x).\n\n"Si" f(x) = u(x) \xb1 v(x), "alors" f\'(x) = u\'(x) \xb1 v\'(x).\n\n## \xc9quations des tangentes et normales\n\n-Si (x\u2081, y\u2081) est un point sur la courbe y = f(x) et si f\'(x\u2081) = m, alors m est le coefficient directeur de la tangente en (x\u2081, y\u2081).\n\n### \xc9quation de la tangente : \n(y \u2013 y_1) = m(x \u2013 x_1).\n### \xc9quation de la normale : \n(y \u2013 y_1) = - 1/m (x \u2013 x_1).\n\n-Si une tangente a pour pente m, alors la pente de la normale est -1/m.\n\n## R\xe8gles de d\xe9rivation\n### R\xe8gle de la cha\xeene (chain rule) :\n-Si y = g(u) o\xf9 u = f(x), alors :\n\n(dy)/dx=(dy)/du .(du)/dx\n\n### R\xe8gle du produit (product rule) :\n"Si" y = u.v, "alors:"  dy/dx=v du/dx + u dv/dx\n\nou encore :\n(uv)\' = u\'v + uv\'\n\n### R\xe8gle du quotient (quotient rule) :\n"Si"  y = u/v, "avec" v(x) \u2260 0, "alors:"  dy/dx = ([v du/dx - u dv/dx])/v\xb2\nou bien:\n(u/v)\' = (u\'v - uv\')/v\xb2\n### D\xe9riv\xe9es d\u2019ordre sup\xe9rieur\n-La d\xe9riv\xe9e seconde :\n f\'\'(x) = (d^2 y)/dx^2\n-En g\xe9n\xe9ral :\n f\u207f(x) = (d^n y)/dx^n, "o\xf9" n = 2, 3, 4, \u2026\n\n## Fonctions croissantes et d\xe9croissantes\n\n-Si f\'(x) > 0 pour tout x \u2208 ]a, b[, alors f est croissante sur cet intervalle.\n\n- Si f\'(x) < 0 pour tout x \u2208 ]a, b[, alors f est d\xe9croissante.\n## Maximum et minimum\n### Test de la premi\xe8re d\xe9riv\xe9e\n\n-Si f\'(c) = 0, on teste s\u2019il y a un point stationnaire :\n\n-Si f\' > 0 pour x < c et f\' < 0 pour x > c, alors f a un maximum local en x = c.\n\n-Si f\' < 0 pour x < c et f\' > 0 pour x > c, alors f a un minimum local en x = c.\n\n### Test de la deuxi\xe8me d\xe9riv\xe9e\n\n-Si f\'(c) = 0 et f\'\'(c) < 0 \u2192 maximum local en x = c.\n\n-Si f\'(c) = 0 et f\'\'(c) > 0 \u2192 minimum local en x = c.\n\n-Si f\'(c) = 0 et f\'\'(c) = 0 \u2192 test inconclusif, on revient au test de la premi\xe8re d\xe9riv\xe9e.\n\n## Points d\u2019inflexion\n-Si f\'\'(c) = 0 et que la concavit\xe9 change en x = c, alors f a un point d\u2019inflexion en x = c.\n\n-Si f\'\'(x) < 0 sur un intervalle, alors f est concave vers le bas.\n\n-Si f\'\'(x) > 0 sur un intervalle, alors f est concave vers le haut.\n\n## Optimisation et cin\xe9matique\n\n-La vitesse v(t) est la d\xe9riv\xe9e de la position s(t).\n v(t)=ds/dt  "ou bien"  v(t)=s\'(t)\n- L\u2019acc\xe9l\xe9ration a(t) est la d\xe9riv\xe9e de la vitesse :\na(t)=dv/dt=(d^2 s)/dt^2 "ou bien" a(t)=v\'(t)=s^(")(t)\n\n-Si v et a ont le m\xeame signe, le mouvement est une acc\xe9l\xe9ration (acc\xe9l\xe9ration positive).\n\n-Si v et a ont des signes diff\xe9rents, le mouvement est une d\xe9c\xe9l\xe9ration.\n## Primitives et int\xe9grale ind\xe9finie\n### R\xe8gle de la puissance :\n\u222b\ud835\udc65^\ud835\udc5b\u2009\ud835\udc51\ud835\udc65 = 1/(\ud835\udc5b+1)x^(n+1) +C  " " \ud835\udc5b \u2260-1\n### R\xe8gle de la constante :\n\u222bkdx=kx+C\n\n### Multiplicateur constant :\n\u222bkf(x)dx=k\u222bf(x)dx\n### Somme ou diff\xe9rence :\n\u222b[f(x) \xb1 g(x)]dx=\u222bf(x)dx\xb1\u222bg(x)dx\n\n## Quelques int\xe9grales usuelles\n\n\u222b1/x dx=ln \u2061\u2223\ud835\udc65\u2223+\ud835\udc36\n\u222b\ud835\udc52^\ud835\udc65\u2009\ud835\udc51\ud835\udc65 =\ud835\udc52^\ud835\udc65 +\ud835\udc36\n\u222be^(ax)\u2009dx =1/(\ud835\udc4e) e^(ax) +C\n\u222b(\ud835\udc4e\ud835\udc65 +\ud835\udc4f)^\ud835\udc5b \u2009\ud835\udc51\ud835\udc65=((ax+b)^(n+1))/a(n+1) + C\n\u222b1/(ax+b) dx=1/a ln|ax+b| + C\n### Propri\xe9t\xe9s des int\xe9grales d\xe9finies\n\u222b_a^b kf(x)dx=k\u222b_a^b f(x)dx\n\u222b_a^b (f(x) \xb1 g(x) )dx=\u222b_a^b f(x) dx \xb1 \u222b_a^b g(x) dx\n\u222b_a^a f(x)dx=0\n\u222b_a^b f(x)dx=\u2212\u222b_b^a f(x)dx\n"Si"  a<c<b,  "alors" \u222b_a^c f(x) dx=\u222b_a^c f(x) dx + \u222b_c^b f(x) dx\n\n## Th\xe9or\xe8me fondamental de l\u2019analyse\n\n-Si f est continue sur  [a,b] et si F est une primitive de f, alors :\n\u222b_a^b f(x)dx=F(b)\u2212F(a).\n\n## Aire sous une courbe\n-Si  f(x) \u2265 0 pour  a \u2264 x \u2264 b, alors :\nAire=\u222b_a^b f(x) dx\n## Aire entre deux courbes\n-Si y\u2081 et y\u2082 sont continues sur  [a,b] et y\u2081 (x) \u2265 y\u2082(x) pour tout x\u2208[a,b], alors :\nAire=\u222b_a^b [y_1 (x) \u2212 y_2 (x)]dx\n\n## D\xe9riv\xe9es et int\xe9grales de sin et cos\n\nf(x) = sin x \u21d2 f\'(x) = cos x\n\nf(x) = cos x \u21d2 f\'(x) = \u2013sin x\n\n\u222bcosx dx = sinx+C\n\n\u222bsinxdx=\u2013cosx+C\n\n\u222bsin(ax+b)dx=\u20131/a cos(ax+b)+C\n\n\u222bcos(ax+b)dx=1/a sin(ax+b)+C\n\n## Cin\xe9matique (application des int\xe9grales)\n\n-Si v(t) est la vitesse en fonction du temps, alors sur l\u2019intervalle [a, b] :\n\n"D\xe9placement:"  \u222b_a^b v(t)dt \n\n"Distance parcourue:"   \u222b_a^b|v(t)|dt ',"theme5",B.ahY,"Analyse math\xe9matique",A.d(["D\xe9riv\xe9es, pentes, tangentes et normale","Sens de variations et ext\xe9mum d'une fonction","Int\xe9grales et aire","Cin\xe9matique"],q))],A.a2("v<NF>"))})
